    }, [])
  return (
    <div className="MenuContainer">
        <p className="title">{title}</p>
        <ul>
            {
                menuObject && menuObject.map((menu)=>(
                    <li>
                        <a href="#">
                            <i>{menu.icon}</i>
                            <span>{menu.name}</span>
                        </a>
                    </li>
                ))
            }
        </ul>
    </div>
  )
}

